SET search_path TO ardor;

CREATE TABLE M_USER(
	ID SERIAL2 NOT NULL,
	USER_CODE VARCHAR(20) NOT NULL,
	LOGIN_EMAIL VARCHAR(100) NOT NULL,
	LOGIN_PASSWORD VARCHAR(100) NOT NULL,
	FIRST_NAME VARCHAR(50) NOT NULL,
	LAST_NAME VARCHAR(50) NOT NULL,
	MIDDLE_NAME VARCHAR(50),
	MOBILE VARCHAR(100) NOT NULL,
	ADDRESS VARCHAR(500) NOT NULL,
	CITY VARCHAR(100),
	STATE_CODE VARCHAR(3),
	COUNTRY_CODE VARCHAR(3),
	PIN_CODE VARCHAR(20),
	USER_TYPE_CODE VARCHAR(3) NOT NULL,
	STATUS_CODE VARCHAR(3) NOT NULL,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	IS_APPROVED BIT DEFAULT '0' NOT NULL,
	PARENT_CODE VARCHAR(20),
	UNIQUE_CODE VARCHAR(20),
	API_KEY VARCHAR(250),
	APPROVED_BY VARCHAR(20),
	APPROVED_AT TIMESTAMPTZ,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT MU_PK PRIMARY KEY (ID),
	CONSTRAINT MU_UC_UN UNIQUE (USER_CODE),
	CONSTRAINT MU_LE_UN1 UNIQUE (LOGIN_EMAIL),
	CONSTRAINT MU_AK_UN2 UNIQUE (API_KEY),
	CONSTRAINT MU_UTC_FK FOREIGN KEY(USER_TYPE_CODE) REFERENCES M_USER_TYPE(CODE),
	CONSTRAINT MU_SC_FK FOREIGN KEY(STATUS_CODE) REFERENCES M_USER_STATUS(CODE)
);

CREATE INDEX MU_CODE_IDX ON M_USER (USER_CODE,LOGIN_EMAIL,LOGIN_PASSWORD,STATUS_CODE,IS_ACTIVE,USER_TYPE_CODE);



