CREATE TABLE M_MENU(
	ID SERIAL2 NOT NULL,
	MENU_CODE VARCHAR(3) NOT NULL,
	MENU_NAME VARCHAR(50) NOT NULL,
	DESCRIPTION VARCHAR(100),
	MENU_TYPE_CODE VARCHAR(3) NOT NULL,
	MENU_PATH VARCHAR(250) NOT NULL,
	IS_PARENT BIT DEFAULT '0' NOT NULL,
	PARENT_CODE VARCHAR(3),
	SEQUENCE_NO INT,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT MM_PK PRIMARY KEY (ID),
	CONSTRAINT MM_UN UNIQUE (MENU_CODE),
	CONSTRAINT MM_MTC_FK FOREIGN KEY(MENU_TYPE_CODE) REFERENCES M_MENU_TYPE(CODE)
);

CREATE INDEX MM_CODE_IDX ON M_MENU(MENU_CODE,IS_ACTIVE);



CREATE TABLE M_FUNCTION(
	ID SERIAL2 NOT NULL,
	FUNCTION_CODE VARCHAR(3) NOT NULL,
	FUNCTION_NAME VARCHAR(50) NOT NULL,
	DESCRIPTION VARCHAR(100),
	FUNCTION_TYPE_CODE VARCHAR(3) NOT NULL,
	FUNCTION_PATH VARCHAR(250) NOT NULL,
	IS_PARENT BIT DEFAULT '0' NOT NULL,
	PARENT_CODE VARCHAR(3),
	SEQUENCE_NO INT,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT MF_PK PRIMARY KEY (ID),
	CONSTRAINT MF_UN UNIQUE (FUNCTION_CODE),
	CONSTRAINT MF_FTC_FK FOREIGN KEY(FUNCTION_TYPE_CODE) REFERENCES M_FUNCTION_TYPE(CODE)
);

CREATE INDEX MF_CODE_IDX ON M_FUNCTION(FUNCTION_CODE,IS_ACTIVE);


CREATE TABLE LINK_MENU_FUNCTION(
	ID SERIAL2 NOT NULL,
	MENU_CODE VARCHAR(3) NOT NULL,
	FUNCTION_CODE VARCHAR(3) NOT NULL,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CONSTRAINT LMF_PK PRIMARY KEY (ID),
	CONSTRAINT LMF_UN UNIQUE (MENU_CODE,FUNCTION_CODE),
	CONSTRAINT LMF_MC_FK FOREIGN KEY(MENU_CODE) REFERENCES M_MENU(MENU_CODE),
	CONSTRAINT LMF_FC_FK FOREIGN KEY(FUNCTION_CODE) REFERENCES M_FUNCTION(FUNCTION_CODE)
);

CREATE INDEX LMF_IDX ON LINK_MENU_FUNCTION(MENU_CODE,FUNCTION_CODE,IS_ACTIVE);




CREATE TABLE M_ROLE(
	ID SERIAL2 NOT NULL,
	ROLE_CODE VARCHAR(3) NOT NULL,
	ROLE_NAME VARCHAR(50) NOT NULL,
	DESCRIPTION VARCHAR(100),
	ROLE_PATH VARCHAR(250) NOT NULL,
	IS_PARENT BIT DEFAULT '0' NOT NULL,
	PARENT_CODE VARCHAR(3),
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT MR_PK PRIMARY KEY (ID),
	CONSTRAINT MR_UN UNIQUE (ROLE_CODE)
);

CREATE INDEX MR_CODE_IDX ON M_ROLE(ROLE_CODE,IS_ACTIVE);


CREATE TABLE LINK_ROLE_MENU(
	ID SERIAL2 NOT NULL,
	ROLE_CODE VARCHAR(3) NOT NULL,
	MENU_CODE VARCHAR(3) NOT NULL,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CONSTRAINT LRM_PK PRIMARY KEY (ID),
	CONSTRAINT LRM_UN UNIQUE (ROLE_CODE,MENU_CODE),
	CONSTRAINT LRM_RC_FK FOREIGN KEY(ROLE_CODE) REFERENCES M_ROLE(ROLE_CODE),
	CONSTRAINT LRM_MC_FK FOREIGN KEY(MENU_CODE) REFERENCES M_MENU(MENU_CODE)
);

CREATE INDEX LRM_IDX ON LINK_ROLE_MENU(ROLE_CODE,MENU_CODE,IS_ACTIVE);


CREATE TABLE LINK_USER_ROLE(
	ID SERIAL2 NOT NULL,
	USER_CODE VARCHAR(3) NOT NULL,
	ROLE_CODE VARCHAR(3) NOT NULL,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CONSTRAINT LUR_PK PRIMARY KEY (ID),
	CONSTRAINT LUR_UN UNIQUE (USER_CODE,ROLE_CODE),
	CONSTRAINT LUR_MC_FK FOREIGN KEY(USER_CODE) REFERENCES M_USER(USER_CODE),
	CONSTRAINT LUR_RC_FK FOREIGN KEY(ROLE_CODE) REFERENCES M_ROLE(ROLE_CODE)
);

CREATE INDEX LUR_IDX ON LINK_USER_ROLE(USER_CODE,ROLE_CODE,IS_ACTIVE);

CREATE TABLE LINK_USER_API_KEY(
	ID SERIAL2 NOT NULL,
	USER_CODE VARCHAR(20) NOT NULL,
	API_TYPE_CODE VARCHAR(3) NOT NULL,
	API_NAME VARCHAR(50) NOT NULL,
	API_KEY VARCHAR(2000) NOT NULL,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT LUAK_PK PRIMARY KEY (ID),
	CONSTRAINT LUAK_UN UNIQUE (USER_CODE,API_TYPE_CODE),
	CONSTRAINT LUAK_SC_FK FOREIGN KEY(USER_CODE) REFERENCES M_USER(USER_CODE),
	CONSTRAINT LUAK_ATC_FK FOREIGN KEY(API_TYPE_CODE) REFERENCES M_ARDOR_API_TYPE(CODE)
);



